import Task from './Task'

const Tasks = ({ tasks, onDelete, onToggle, onPostSelected, saved}) => {

    return (
        <div>
            {tasks.map((task) => (
                <Task key={task.localId} task={task} onDelete={onDelete} onToggle={onToggle} onPostSelected={onPostSelected} saved={saved}/>
            ))}

        </div>
    )
}

export default Tasks
